PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE Table3 (
    id INT PRIMARY KEY,
    bnb_name VARCHAR(255),
    host_id INT,
    host_name VARCHAR(255),
    neighborhood_group VARCHAR(255),
    neighborhood VARCHAR(255),
    latitude DECIMAL(10, 8), -- decimal value with precision 10 and scale 8
    longitude DECIMAL(11, 8), -- decimal value with precision 11 and scale 8
    room_type VARCHAR(50),
    price DECIMAL(10, 2), -- decimal value with precision 10 and scale 2
    minimum_nights INT,
    number_of_reviews INT, 
    last_review VARCHAR(50),
    reviews_per_month DECIMAL(5, 2), -- decimal value with precision 5 and scale 2
    calculated_host_listings_count INT,
    availability_365 INT
);

UPDATE Table3 
SET last_review = STR_TO_DATE(last_review, '%m/%d/%Y');
ALTER TABLE Table3 MODIFY last_review DATE;
COMMIT;
